import React from "react";
import { Box, Drawer, List, ListItemButton, Typography } from "@mui/material";

function Sidebar() {
  return (
    <Drawer
      container={window.document.body}
      variant="permanent"
      open={true}
      sx={{ width: 250, height: "100vh" }}
    >
      <List>
        <ListItemButton>
          <Box>
            <Typography>yusei</Typography>
          </Box>
        </ListItemButton>
      </List>
    </Drawer>
  );
}

export default Sidebar;
